import React from "react";
import { ListResult } from "../Components/ListResult"

export const SearchingPage = ({ results }) => {
	return <>{results.map(result =>
		<ListResult
			key={result.url}
			url={result.url}
			title={result.title}
			snippet={result.snippet}
		/>
	)}</>
}
